    private static JFreeChart createScatterChart(double[] velocidades, double[] consumos, double[] gastos) {
        XYSeries seriesVelocidade = new XYSeries("Velocidade");
        XYSeries seriesConsumo = new XYSeries("Consumo");
        XYSeries seriesGastos = new XYSeries("Gastos");

        for (int i = 0; i < velocidades.length; i++) {
            seriesVelocidade.add(i + 1, velocidades[i]);
            seriesConsumo.add(i + 1, consumos[i]);
            seriesGastos.add(i + 1, gastos[i]);
        }

        XYSeriesCollection dataset = new XYSeriesCollection();
        dataset.addSeries(seriesVelocidade);
        dataset.addSeries(seriesConsumo);
        dataset.addSeries(seriesGastos);

        return ChartFactory.createScatterPlot(
                "Gráfico de Dispersão",
                "Ponto",
                "Valores",
                dataset,
                PlotOrientation.VERTICAL,
                true, true, false
        );
    }

    private static void displayChart(JFreeChart chart, String title) {
        SwingUtilities.invokeLater(() -> {
            JFrame frame = new JFrame(title);
            frame.setSize(600, 400);
            frame.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);

            ChartPanel chartPanel = new ChartPanel(chart);
            chartPanel.setPreferredSize(new Dimension(560, 370));
            frame.setContentPane(chartPanel);

            frame.pack();
            frame.setLocationRelativeTo(null);
            frame.setVisible(true);
        });
    }

